import './App.css';
import Header from './components/Header';
import Home from './components/Home';
import { BrowserRouter as Router, Route, Switch, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
      <div className="App" dir="rtl">
        <Header />
        <Routes>
          {
            <Route exact path='/'>
              <Home />
            </Route>
          }
        </Routes>
      </div>
    </Router>
    </div>
  );
}

export default App;
